<p>无意间看到一个<a href="https://github.com/vuepress-theme-hope/vuepress-theme-hope/issues/3372" target="_blank" rel="noopener noreferrer">issue</a>有提及希望vuepress-theme-hope能新增echarts的词云，看了<a href="https://paper-dragon.github.io/" target="_blank" rel="noopener noreferrer">paper-dragon</a>的成果，果然很赞。但是由于目前theme-hope兼容的echarts图表有限，因此采用了“另辟蹊径”的方法来实现动态获取博客所有文章关键词，然后在博客中动态显示（每git push一次就自动更新词云）</p>
